Running command: python - <<'PY'
import requests

targets={
    '21d3e683-80a4-4d9b-bc89-ebb2df513dde',
    '0b75c598-0893-4216-afe8-5414cab7739d',
}

cols=requests.get('https://api.cellxgene.cziscience.com/dp/v1/collections', timeout=20).json()['collections']
print('collections', len(cols))
found={t: None for t in targets}
for i,c in enumerate(cols):
    cid=c['id']
    detail=requests.get(f'https://api.cellxgene.cziscience.com/dp/v1/collections/{cid}', timeout=20).json()
    for d in detail.get('datasets', []):
        for dep in d.get('dataset_deployments', []) or []:
            url=dep.get('url','')
            for t in list(targets):
                if t in url:
                    found[t]=(cid, d['id'], url, d)
                    targets.remove(t)
                    print('matched', t, 'in collection', cid, 'dataset', d['id'])
            if not targets:
                break
        if not targets:
            break
    if not targets:
        break
    if (i+1)%50==0:
        print('checked', i+1)
print('done. found keys', {k: (v[0], v[1]) if v else None for k,v in found.items()})
